import React from 'react';

function PDFViewer(props){
  let currentCard = props.currentCard;
  return (
    <div className="PDFViewer">
      <div className="PDFViewerText">
        <p>{currentCard.name}</p>
        <p>{currentCard.japaneseName}</p>
        <p>{currentCard.age}</p>
        <p>{currentCard.job}</p>
      </div>
      <div className="blackGradient"></div>
      <img className="PDFViewerImage" alt="Background image" src={currentCard.image} />
    </div>
  )
}

export default PDFViewer;
